import { Link } from 'react-router-dom';

export default function BookList(){
  return (
    <>
      <h3>This is book list.</h3>
      <Link to="/book/1">book 1</Link>
      <Link to="/book/2">book 2</Link>
      <Link to="/book/3">book 3</Link>
    </>
  )
}
